import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  TextField,
  Button,
  Grid,
  Paper,
  Divider,
} from "@mui/material";

const MyCarListingPage = () => {
  const [cars, setCars] = useState([]);

  const user = JSON.parse(sessionStorage.getItem("user"));
  const userId = user?.id;

  useEffect(() => {
    if (!userId) return;
    axios
      .get(`http://localhost:3030/api/car/user/${userId}`)
      .then((res) => setCars(res.data))
      .catch((err) => console.error("Failed to fetch user's cars", err));
  }, [userId]);

  const handleChange = (index, field, value) => {
    const updatedCars = [...cars];
    updatedCars[index][field] = value;
    setCars(updatedCars);
  };

  const handleUpdate = (car) => {
    axios
      .put(`http://localhost:3030/api/car/${car.id}`, car)
      .then((res) => alert("Car updated successfully."))
      .catch((err) => console.error("Update failed", err));
  };

  const handleDelete = (carId) => {
    axios
      .delete(`http://localhost:3030/api/car/${userId}/${carId}`)
      .then(() => {
        setCars((prev) => prev.filter((c) => c.id !== carId));
        alert("Car deleted successfully.");
      })
      .catch((err) => console.error("Delete failed", err));
  };

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom>
        🚗 My Car Listings
      </Typography>
      <Grid container spacing={3}>
        {cars.map((car, index) => (
          <Grid item xs={12} md={6} key={car.id}>
            <Paper elevation={3} sx={{ p: 3 }}>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField
                    label="Brand"
                    fullWidth
                    value={car.brand}
                    onChange={(e) =>
                      handleChange(index, "brand", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    label="Model"
                    fullWidth
                    value={car.model}
                    onChange={(e) =>
                      handleChange(index, "model", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={6}>
                  <TextField
                    label="Price"
                    fullWidth
                    type="number"
                    value={car.price}
                    onChange={(e) =>
                      handleChange(index, "price", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={6}>
                  <TextField
                    label="Kilometers"
                    fullWidth
                    type="number"
                    value={car.km}
                    onChange={(e) => handleChange(index, "km", e.target.value)}
                  />
                </Grid>
                <Grid item xs={6}>
                  <TextField
                    label="Year"
                    fullWidth
                    type="number"
                    value={car.year}
                    onChange={(e) =>
                      handleChange(index, "year", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={6}>
                  <TextField
                    label="Fuel Type"
                    fullWidth
                    value={car.fuel}
                    onChange={(e) =>
                      handleChange(index, "fuel", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    label="Avg. Consumption"
                    fullWidth
                    value={car.avgConsumption}
                    onChange={(e) =>
                      handleChange(index, "avgConsumption", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    label="Contact"
                    fullWidth
                    value={car.contact}
                    onChange={(e) =>
                      handleChange(index, "contact", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    label="Description"
                    fullWidth
                    multiline
                    minRows={2}
                    value={car.description}
                    onChange={(e) =>
                      handleChange(index, "description", e.target.value)
                    }
                  />
                </Grid>
                <Grid item xs={6}>
                  <Button
                    variant="contained"
                    color="primary"
                    fullWidth
                    onClick={() => handleUpdate(car)}
                  >
                    Update
                  </Button>
                </Grid>
                <Grid item xs={6}>
                  <Button
                    variant="outlined"
                    color="error"
                    fullWidth
                    onClick={() => handleDelete(car.id)}
                  >
                    Delete
                  </Button>
                </Grid>
              </Grid>
            </Paper>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default MyCarListingPage;
